import React from 'react';
import { AppBar, Grid, Toolbar } from '@mui/material';
//import useStyles from './styles';

function Navbar() {
    //const classes = useStyles();

    return (
        <AppBar>
            <Toolbar>
                <Grid container>
                    <Grid item>
                        Calendar
                    </Grid>
                    <Grid item>
                        New event
                    </Grid>
                    <Grid item>
                        User or sign in
                    </Grid>
                </Grid>
            </Toolbar>
        </AppBar>
    )
}

export default Navbar;
